  [],\n\t\"revision_timestamp\": \"2016-07-27T22:52:43.260612\",\n\t\"name\": \"slade-waterfowl-production-area-narrative-report-1969\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Slade
  National Wildlife Refuge outlines Refuge accomplishments during the 1969 calendar
  year.  The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, fish, and reptiles- is also covered. The Refuge development and
  maintenance section discusses physical developments, plantings, collections and
  receipts, vegetation control, prescribed burning, and wildfires. Resource management
  is outlined; topics include grazing and fur harvesting. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest, N-R forms, and photographs are
  attached\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
